    n = int(stdin.split()[0])
    arr = list(map(int, stdin.split()[1]))

    def find_increasing_sequence(arr: list, n: int, last_num: int) -> int:
        if not arr:
            return 0

        length_of_subsequence = 1
        while arr:
            if arr[0] >= last_num:
                arr.pop(0)
            else:
                break

        if not arr:
            return length_of_subsequence

        for i in range(len(arr) - 1):
            if arr[i] + 1 == arr[i + 1]:
                length_of_subsequence += 1
            else:
                break

        if not arr:
            return length_of_subsequence

        for i in range(len(arr) - 1):
            if arr[i] == arr[i + 1] - 1:
                length_of_subsequence += 1
            else:
                break

        return length_of_subsequence

    increasing_sequence = find_increasing_sequence(arr, n, arr[0])
    return str(increasing_sequence) + '\n' +''.join(map(str, arr[:increasing_sequence]))


