    def check_if_sudoku(mat):
        # check row
        for row in mat:
            if len(set(row)) == len(row):
                return False
        # check column
        for i in range(9):
            column = []
            for j in range(9):
                column.append(mat[j][i])
            if len(set(column)) == len(column):
                return False
        # check block
        for i in range(3):
            for j in range(3):
                block = []
                for k in range(3):
                    for l in range(3):
                        block.append(mat[i*3+k][j*3+l])
                if len(set(block)) == len(block):
                    return False
        return True

    def check_if_valid(mat, r, c, val):
        # check row
        for i in range(9):
            if mat[r][i] == val:
                return False
        # check column
        for i in range(9):
            if mat[i][c] == val:
                return False
        # check block
        for i in range(3):
            for j in range(3):
                if mat[i+r//3][j+c//3] == val:
                    return False
        return True

    def solve(mat, r, c):
        if r == 9:
            return True
        if c == 9:
            return solve(mat, r + 1, 0)
