    n, b, h, w, *p = map(int, stdin.split())
    # Define the matrix to store the maximum cost for each hotel
    costs = [[float('inf') for _ in range(w)] for _ in range(h)]
    # For each hotel, for each week, define a tuple of (beds, price)
    for h_idx in range(h):
        costs[h_idx] = list(map(lambda x: x[0], filter(lambda x: x[1] >= p[h_idx], enumerate(map(lambda x: x[0], p)))))
    # We want to find the minimum cost for each of the participants
    min_cost = float('inf')
    for person in range(n):
        # For each hotel, find the minimum cost
        cost = 0
        for week in range(w):
            # Find the cheapest bed for each weekend
            for bed in costs[week]:
                cost += (week + 1) * bed
            # We also want to stay in the same hotel
            cost += person
            # Check if we still have enough budget
            if cost <= b:
                # Found a lower cost
                min_cost = min(min_cost, cost)
    # We found a stay home iff min_cost = float('inf')
    if min_cost == float('inf'):
        return'stay home'
    else:
        return str(min_cost)

